/** When your routing table is too long, you can split it into small modules **/

import Layout from '@/layout'

const dataRouter = {
  path: '/data',
  component: Layout,
  redirect: '/data/sales-channel',
  name: 'Data',
  meta: {
    title: '数据系统',
    icon: 'table'
  },
  children: [
    {
      path: 'product-type',
      component: () => import('@/views/data/product-type'),
      name: 'Product Type',
      meta: { title: '产品类型' }
    },
    {
      path: 'product-sub-type',
      component: () => import('@/views/data/product-sub-type'),
      name: 'Product Type',
      meta: { title: '产品细分' }
    },
    {
      path: 'product',
      component: () => import('@/views/data/product'),
      name: 'Product Type',
      meta: { title: '产品' }
    },
    {
      path: 'sales-channel',
      component: () => import('@/views/data/sales-channel'),
      name: 'Sales Channel',
      meta: { title: '直销渠道列表' }
    },
    {
      path: 'event',
      component: () => import('@/views/data/event'),
      name: 'Event',
      meta: { title: '线下活动列表' }
    }
  ]
}
export default dataRouter
